import React, { memo } from 'react';
import PropTypes from 'prop-types';

import cx from 'classnames';
import { Box, Button } from '@material-ui/core';

import useStyles from './styled';

const LoginButtons = ({ actionButtons }) => {
  const classes = useStyles();
  return (
    <Box
      pt={{ xs: '40px', lg: '80px' }}
      style={{ background: 'linear-gradient(180deg, #F2F6FF 0%, rgba(242, 246, 255, 0) 100%)' }}
      mb="48px"
    >
      {actionButtons.map(item => (
        <Button
          variant="contained"
          size="large"
          className={cx([classes.whiteButton, classes.loginButton])}
          startIcon={item.icon}
          key={item.title}
        >
          {item.title}
        </Button>
      ))}
    </Box>
  );
};

LoginButtons.defaultProps = {
  actionButtons: [
    {
      title: null,
      icon: null,
    },
  ],
};

LoginButtons.propTypes = {
  actionButtons: PropTypes.arrayOf(
    PropTypes.shape({
      title: PropTypes.string,
      icon: PropTypes.node,
    }),
  ),
};

export default memo(LoginButtons);
